<?php

    include('sqlconnect.php'); 
    include('auth.php'); 
    
    
    if (session_status() === PHP_SESSION_NONE) {
        session_start();
    }

    if (isset($_GET['status']) && $_GET['status'] === 'expired') {
        add_toast('Your session has expired due to inactivity. Please log in again.', 'expired');
    }
    
    // If a user is already logged in, redirect them
    if (isset($_SESSION['AccountID'])) {
        if ($_SESSION['Role'] === 'Administrator') {
            header('Location: admin-dashboard.php');
        } else {
            header('Location: user-dashboard.php');
        }
        exit();
    }
    
    // Helper function to log user in
    function logUserIn($conn, $account) {

        session_regenerate_id(true); 

        $_SESSION['last_activity'] = time(); 

        $_SESSION['AccountID'] = $account['AccountID'];
        $_SESSION['username'] = $account['Username'];
        $_SESSION['Role'] = $account['Role'];

        // Fetch user's first and last name
        $employeeId = $account['EmployeeID'];
        $infoSql = "SELECT p.FirstName, p.LastName 
                    FROM tblpersonalinfo p 
                    JOIN tblemployees e ON p.PersonalID = e.PersonalID 
                    WHERE e.EmployeeID = ?";
        
        $infoStmt = $conn->prepare($infoSql);
        $infoStmt->bind_param("i", $employeeId);
        $infoStmt->execute();
        $infoResult = $infoStmt->get_result();

        if ($infoResult->num_rows > 0) {
            $pinfo = $infoResult->fetch_assoc();
            $_SESSION['firstname'] = $pinfo['FirstName'];
            $_SESSION['lastname']  = $pinfo['LastName'];
        }
        $infoStmt->close();

        // Redirect based on role
        if ($account['Role'] === 'Administrator') {
            header("Location: admin-dashboard.php");
        } elseif ($account['Role'] === 'User') {
            header("Location: user-dashboard.php");
        } else {
            header("Location: index.php"); 
        }
        exit();
    }

    $error_message = "";

    if ($_SERVER["REQUEST_METHOD"] == "POST") {

        // --- UPDATED: NFC LOGIN LOGIC (WITH PASSWORD) ---
        if (isset($_POST['nfc_code'])) {
            $nfc_code = $_POST['nfc_code'] ?? '';
            $nfc_password = $_POST['nfc_password'] ?? '';

            if (empty($nfc_code) || empty($nfc_password)) {
                $error_message = "Please scan your card and enter the 4-pin password.";
            } else {
                // JOIN tblemployees to get EmploymentStatus
                $sql = "SELECT a.AccountID, a.EmployeeID, a.Role, a.Username, a.ICPassword, e.EmploymentStatus 
                        FROM tblaccounts a 
                        JOIN tblemployees e ON a.EmployeeID = e.EmployeeID 
                        WHERE a.ICCode = ?";
                $stmt = $conn->prepare($sql);
                $stmt->bind_param("s", $nfc_code);
                $stmt->execute();
                $result = $stmt->get_result();

                if ($result->num_rows > 0) {
                    $account = $result->fetch_assoc();
                    // Check password
                    if ($nfc_password === $account['ICPassword']) {
                        // Check Status
                        if ($account['EmploymentStatus'] === 'Inactive') {
                            $error_message = "Login failed: This account is Inactive.";
                        } else {
                            logUserIn($conn, $account);
                        }
                    } else {
                        $error_message = "Invalid NFC ID or password.";
                    }
                } else {
                    $error_message = "Invalid NFC ID or password.";
                }
                $stmt->close();
            }
        
        // --- STANDARD LOGIN LOGIC (remains the same) ---
        } else {
            $username = $_POST['username'] ?? '';
            $password = $_POST['password'] ?? '';

            if (empty($username) || empty($password)) {
                $error_message = "Please enter both username and password.";
            } else {
                // JOIN tblemployees to get EmploymentStatus
                $sql = "SELECT a.AccountID, a.EmployeeID, a.Password, a.Role, a.Username, e.EmploymentStatus 
                        FROM tblaccounts a 
                        JOIN tblemployees e ON a.EmployeeID = e.EmployeeID 
                        WHERE a.Username = ?";
                $stmt = $conn->prepare($sql);
                $stmt->bind_param("s", $username);
                $stmt->execute();
                $result = $stmt->get_result();

                if ($result->num_rows > 0) {
                    $account = $result->fetch_assoc();
                    
                    if (password_verify($password, $account['Password'])) {
                        // Check Status
                        if ($account['EmploymentStatus'] === 'Inactive') {
                            $error_message = "Login failed: This account is Inactive.";
                        } else {
                            logUserIn($conn, $account);
                        }
                    } else {
                        $error_message = "Invalid username or password.";
                    }
                } else {
                    $error_message = "Invalid username or password.";
                }
                $stmt->close();
            }
        }
    }
    $conn->close();
?>

